from collections import deque

class GameObject:
    def __init__(self, x, y):
        self.x = x
        self.y = y

class GameScene:
    def __init__(self):
        self.objects = deque()
        for i in range(10):
            obj = GameObject(i, i)
            self.objects.append(obj)

    def update_objects(self):
        for obj in self.objects:
            obj.x += 1
            obj.y += 1

    def shift_objects(self):
        self.objects.rotate(-1)

scene = GameScene()
for i in range(5):
    scene.update_objects()
    scene.shift_objects()
    print([obj.x for obj in scene.objects])
```

