import requests

class DataProcessor:
    def fetch_data(self, url):
        response = requests.get(url)
        return response.json()

    def process_data(self, data_list):
        return list(set(data_list))

    def run(self, url1, url2):
        data1 = self.fetch_data(url1)
        data2 = self.fetch_data(url2)
        all_data = data1 + data2
        return self.process_data(all_data)

processor = DataProcessor()
url1 = "https://api.example.com/data1"
url2 = "https://api.example.com/data2"

processed_data = processor.run(url1, url2)
print(processed_data)
