import sys

def install_package(package):
    try:
        subprocess.check_call(["pip", "install", "--upgrade", package])
    except subprocess.CalledProcessError as e:
        if e.returncode == 1:
            print(f"Error installing {package}: {e}")
        else:
            print(f"Error installing {package}: {e}")
            sys.exit(1)
