import requests

class CMS:
    def __init__(self, base_url):
        self.base_url = base_url
        self.session = requests.Session()

    def login(self, username, password):
        login_url = f"{self.base_url}/login"
        data = {"username": username, "password": password}
        response = self.session.post(login_url, data=data)
        if response.status_code == 200:
            print("Login successful")
        else:
            print("Login failed")

    def build_job(self, job_name):
        build_url = f"{self.base_url}/build"
        data = {"job_name": job_name}
        response = self.session.post(build_url, data=data, params={'job_id': job_name})
        if response.status_code == 200:
            print(f"Job {job_name} built successfully")
        else:
            print(f"Failed to build job {job_name}")

cms = CMS("https://example.com")

